OpenLayers.Lang.ru=OpenLayers.Util.applyDefaults({unhandledRequest:"Необработанный запрос вернул ${statusText}",Permalink:"Постоянная ссылка",Overlays:"Слои","Base Layer":"Основной слой",readNotImplemented:"Чтение не реализовано.",writeNotImplemented:"Запись не реализована.",noFID:"Невозможно обновить объект, для которого нет FID.",errorLoadingGML:"Ошибка при загрузке файла GML ${url}",browserNotSupported:"Ваш браузер не поддерживает векторную графику. На данный момент поддерживаются:\n${renderers}",componentShouldBe:"addFeatures: компонент должен быть ${geomType}",getFeatureError:"getFeatureFromEvent вызван для слоя без рендерера. Обычно это говорит о том, что вы уничтожили слой, но оставили связанный с ним обработчик.",minZoomLevelError:"Свойство minZoomLevel предназначено только для использования со слоями, являющимися потомками FixedZoomLevels. То, что этот WFS-слой проверяется на minZoomLevel — реликт прошлого. Однако мы не можем удалить эту функцию, так как, возможно, от неё зависят некоторые основанные на OpenLayers приложения. Функция объявлена устаревшей — проверка minZoomLevel будет удалена в 3.0. Пожалуйста, используйте вместо неё настройку мин/макс разрешения, описанную здесь: http://trac.openlayers.org/wiki/SettingZoomLevels",commitSuccess:"Транзакция WFS: УСПЕШНО ${response}",commitFailed:"Транзакция WFS: ОШИБКА ${response}",googleWarning:"Слой Google не удалось нормально загрузить.<br><br>Чтобы избавиться от этого сообщения, выбите другой основной слой в переключателе в правом верхнем углу.<br><br>Скорее всего, причина в том, что библиотека Google Maps не была включена или не содержит корректного API-ключа для вашего сайта.<br><br>Разработчикам: чтобы узнать, как сделать, чтобы всё заработало, <a href='http://trac.openlayers.org/wiki/Google' target='_blank'>щёлкните тут</a>",getLayerWarning:"Слой ${layerType} не удалось нормально загрузить. <br><br>Чтобы избавиться от этого сообщения, выбите другой основной слой в переключателе в правом верхнем углу.<br><br>Скорее всего, причина в том, что библиотека ${layerLib} не была включена или была включена некорректно.<br><br>Разработчикам: чтобы узнать, как сделать, чтобы всё заработало, <a href='http://trac.openlayers.org/wiki/${layerLib}' target='_blank'>щёлкните тут</a>","Scale = 1 : ${scaleDenom}":"Масштаб = 1 : ${scaleDenom}",W:"З",E:"В",N:"С",S:"Ю",layerAlreadyAdded:"Вы попытались добавить слой «${layerName}» на карту, но он уже был добавлен",reprojectDeprecated:"Вы используете опцию 'reproject' для слоя ${layerName}. Эта опция является устаревшей: ее использование предполагалось для поддержки показа данных поверх коммерческих базовых карт, но теперь этот функционал несёт встроенная поддержка сферической проекции Меркатора. Больше сведений доступно на http://trac.openlayers.org/wiki/SphericalMercator.",methodDeprecated:"Этот метод считается устаревшим и будет удалён в версии 3.0. Пожалуйста, пользуйтесь ${newMethod}.",boundsAddError:"Функции add надо передавать оба значения, x и y.",lonlatAddError:"Функции add надо передавать оба значения, lon и lat.",pixelAddError:"Функции add надо передавать оба значения, x и y.",unsupportedGeometryType:"Неподдерживаемый тип геометрии: ${geomType}",filterEvaluateNotImplemented:"evaluate не реализовано для фильтра данного типа."});